import React, { useState } from 'react'

const Form = () => {
    let [state,setState]=useState("")
    let [state1,setState1]=useState("")
    let [fname,setFname]=useState({fname:""})
    let [lname,setLname]=useState({lname:""})

    let getfname=(event)=>{
        setState(event.target.value)
        console.log(state)
    }
    let getlame=(event)=>{
        setState1(event.target.value)
        console.log(state1)
    }
    const handleChange = (e) => {
      if (e.target.name === 'fname') {
        setFname({ ...fname, [e.target.name]: e.target.value });
      } else if (e.target.name === 'lname') {
        setLname({ ...lname, [e.target.name]: e.target.value });
      }
    };
  
    const handleSubmit = (e) => {
      e.preventDefault();
      setFname(fname.fname); 
      setLname(lname.lname);
      console.log('First Name:', fname.fname);
      console.log('Last Name:', lname.lname);
    };
  return (
    <div>
        <h1>welcome user : {state} {state1}</h1>
        <form action="">
            <input value={state} type="text" onChange={getfname}  /> <br />
            <input value={state1} type="text" onChange={getlame} /> <br />
            <button type='submit'>submit</button>
        </form>
      
      <div>
        <h1> WELCOME USER : <span id='abc'> {fname.fname}</span> {lname.lname}<span id='xyz'></span></h1>
        
        <form action="" onSubmit={handleSubmit} >
            <input  type="text"  name='fname' value={fname.fname} onChange={handleChange} />
            <input type="text" name='lname' value={lname.lname} onChange={handleChange}/>
            <button type='submit'>submit</button>
        </form>
      </div>
    </div>
    
  )
}

export default Form
